import './App.css';
import { MapContainer, } from 'react-leaflet'
import { ZoomControl } from 'https://cdn.esm.sh/react-leaflet/ZoomControl'
import Maps from './components/Maps';
import Markers from './components/Popups';

const App = () => {
  return (
    <MapContainer center={[44.119370, 15.231365]} zoom={13} scrollWheelZoom={true}>
      <Maps />
      <Popups />
      </MapContainer>
  )
}

export default App;
